import React from 'react';
import './About.css';
import theme from '../Imagelogo/theme_pattern.svg';

function About() {
  return (
    <div className='about'>
        <div className="about-title">
            <h1>About Me</h1>
            <img src={theme} alt=''/>
        </div>
        <div className="about-section"></div>
    </div>
  )
}

export default About
